<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN"
"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml"
	xmlns:f="http://java.sun.com/jsf/core"
	xmlns:h="http://java.sun.com/jsf/html"
	xmlns:c="http://java.sun.com/jsp/jstl/core"
	xmlns:ui="http://java.sun.com/jsf/facelets">
<h:head>
	<f:facet name="first">
		<meta http-equiv="Content-Type" content="text/html; charset=UTF-8" />
		<meta http-equiv="X-UA-Compatible" content="IE=edge" />
		<meta name="viewport"
			content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no" />
	</f:facet>
	<h:outputStylesheet
		name="bower_components/bootstrap/dist/css/bootstrap.min.css" />
	<h:outputStylesheet
		name="bower_components/font-awesome/css/font-awesome.min.css" />
	<h:outputStylesheet name="dist/css/AdminLTE.min.css" />
	<h:outputStylesheet name="dist/css/skins/_all-skins.min.css" />
	<h:outputStylesheet name="bower_components/morris.js/morris.css" />
	<h:outputStylesheet
		name="bower_components/jvectormap/jquery-jvectormap.css" />
	<h:outputStylesheet
		name="bower_components/bootstrap-datepicker/dist/css/bootstrap-datepicker.min.css" />
	<h:outputStylesheet
		name="bower_components/bootstrap-daterangepicker/daterangepicker.css" />
	<h:outputStylesheet
		name="plugins/bootstrap-wysihtml5/bootstrap3-wysihtml5.min.css" />
	<h:outputStylesheet name="css/fontfamily.css" />
</h:head>
<h:body>
	<p>Content</p>
</h:body>
<!-- jQuery 3 -->
<h:outputScript name="bower_components/jquery/dist/jquery.min.js" />
<!-- jQuery UI 1.11.4 -->
<h:outputScript name="bower_components/jquery-ui/jquery-ui.min.js" />
<!-- Resolve conflict in jQuery UI tooltip with Bootstrap tooltip -->
<!-- Bootstrap 3.3.7 -->
<h:outputScript
	name="bower_components/bootstrap/dist/js/bootstrap.min.js" />

<!-- Morris.js charts -->
<h:outputScript name="bower_components/raphael/raphael.min.js" />
<h:outputScript name="bower_components/morris.js/morris.min.js" />
<!-- Sparkline -->
<h:outputScript
	name="bower_components/jquery-sparkline/dist/jquery.sparkline.min.js" />
<!-- jvectormap -->
<h:outputScript name="plugins/jvectormap/jquery-jvectormap-1.2.2.min.js" />
<h:outputScript
	name="plugins/jvectormap/jquery-jvectormap-world-mill-en.js" />
<!-- jQuery Knob Chart -->
<h:outputScript
	name="bower_components/jquery-knob/dist/jquery.knob.min.js" />
<!-- daterangepicker -->
<h:outputScript name="bower_components/moment/min/moment.min.js" />
<h:outputScript
	name="bower_components/bootstrap-daterangepicker/daterangepicker.js" />
<!-- datepicker -->
<h:outputScript
	name="bower_components/bootstrap-datepicker/dist/js/bootstrap-datepicker.min.js" />
<!-- Bootstrap WYSIHTML5 -->
<h:outputScript
	name="plugins/bootstrap-wysihtml5/bootstrap3-wysihtml5.all.min.js" />
<!-- Slimscroll -->
<h:outputScript
	name="bower_components/jquery-slimscroll/jquery.slimscroll.min.js" />
<!-- FastClick -->
<h:outputScript name="bower_components/fastclick/lib/fastclick.js" />
<!-- AdminLTE App -->
<h:outputScript name="dist/js/adminlte.min.js" />
<!-- AdminLTE dashboard demo (This is only for demo purposes) -->
<h:outputScript name="dist/js/pages/dashboard.js" />
<!-- AdminLTE for demo purposes -->
<h:outputScript name="dist/js/demo.js" />
</html>
